import './ItemPost.css';

/**
 * Компонента ItemPost
 * @kind component
 */
export const ItemPost = React.memo(function ItemPost({
    id,
    title,
    text,
    imgSrc,
    link,
}) {
    return (
        <div className="ItemPost">
            {imgSrc && <img className='ItemPost__img' src={imgSrc} alt='Тут должна быть картинка но что то сломалось'/>}
            <div className='ItemPost__content'>

            </div>
        </div>
    );
});
